var images;


images = ['data:image/jpeg;base64,', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,'];

let element_picture = document.getElementById('picture');
element_picture.setAttribute("src", images[0]);


document.getElementById('next').addEventListener('click', (event) => {
  let element_picture2 = document.getElementById('picture');
  images.push(images[0]);
  images.shift();
  let element_picture3 = document.getElementById('picture');
  element_picture3.setAttribute("src", images[0]);

});

document.getElementById('pre').addEventListener('click', (event) => {
  let element_picture4 = document.getElementById('picture');
  images.unshift(images.slice(-1)[0]);
  images.pop();
  let element_picture5 = document.getElementById('picture');
  element_picture5.setAttribute("src", images.slice(-1)[0]);

});